                    b[j] = r_i
                else:
                    b[j] = b[j] - -1
        else:
            for j in range(m):
                if b[j] < l_i or b[j] > r_i:
                    continue
                b[j] = l_i + r_i - b[j]
    return [a[b_i - 1] for b_i in b]
